import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Container from 'react-bootstrap/Container';
import '../App.css';

function Header() {

    const topPadd = {
        paddingTop : '25px'
    }
    const navLinks = {
      fontSize : '30px'
    }
  return (
    <div>
      <Navbar collapseOnSelect expand="md">
      <Container>
        <Navbar.Brand href="#home" className='logo'>Yasin<b>.</b></Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav" >
          <Nav className="mx-auto" style={{topPadd, navLinks}}>
            <Nav.Link href="#features">Home</Nav.Link>
            <Nav.Link href="#about">About</Nav.Link>
            <Nav.Link href="#skills">Skills</Nav.Link>
            <Nav.Link href="#blogs">Blogs</Nav.Link>
            
          </Nav>
          <Nav>
            <Nav.Link href="#deets"><ion-icon name="logo-facebook" class="socialIcons"></ion-icon></Nav.Link>
            <Nav.Link href="#deets"><ion-icon name="logo-instagram" class="socialIcons"></ion-icon></Nav.Link>
            <Nav.Link href="#deets"><ion-icon name="logo-twitter" class="socialIcons"></ion-icon></Nav.Link>
            </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
    </div>
  );
}

export default Header;
